import './App.css';
import { SignIn } from '../src/components/SignIn';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import { SignUp } from './components/Signup';


function App() {
  return (
    <>
      {/* {<SignIn />} */}
     <BrowserRouter>
      <Routes>
        <Route>
        <Route path="/SignUp" component={ SignUp} />
            <Route path="/SignIn" component={SignIn} />
        </Route>
      </Routes>
     </BrowserRouter>

    </>

  );
}

export default App;
